import React, { Component } from "react";
import './body.css'


class Body extends Component
{
    constructor(props)
    {

        super(props);

        this.state = {
            name: '',
            password: '',
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({
            [event.target.name]: event.target.value
        });
    }

    handleSubmit(event) {
        console.log( JSON.stringify(this.state));
        event.preventDefault();
    }

    render()
    {
        return(
            <div className="page-holder bg-cover">

                <div className="container py-5 ">
                    <header className="text-center text-grey py-5 animate__animated animate__fadeInUpBig ">
                        <h4 className="display-4 font-weight-bold mb-4">Wallet As A Service</h4>
                    </header>

                    <div className="bg_grey" style={{boxShadow:' 10px -10px  rgba(0,0,0,0.6);'}}>
                        <form onSubmit={this.handleSubmit}>
                            <h3>Log In</h3>

                            <div className="form-group">
                                <label>Username</label>
                                <input type="text" className="form-control" placeholder="Enter username" required="required" id="name" name="name" value={this.state.name} onChange={this.handleChange}/>
                            </div>

                            <div className="form-group">
                                <label>Password</label>
                                <input type="password" className="form-control" placeholder="Enter password" required="required" id="password" name="password" value={this.state.password} onChange={this.handleChange}/>
                            </div>


                            <br/>
                            <button type="submit" className="btn btn-primary btn-block">Login</button>
                            <br/>
                            <p className="forgot-password text-right">
                                New User ? <a href="/register"> Register here</a>
                            </p>
                        </form>
                    </div>



                </div>

            </div>
        )
    }
}
export default Body;

